import React, { useEffect, useMemo, useState } from 'react';
import styled from 'styled-components';
import axios from 'axios';
import authService from '../services/authService';

const Container = styled.div`
  padding: 1rem 0;
`;

const Title = styled.h1`
  font-size: 1.6rem;
  color: #333;
  margin-bottom: 1rem;
`;

const Controls = styled.div`
  display: flex;
  gap: 12px;
  align-items: center;
  margin-bottom: 1rem;
`;

const SearchInput = styled.input`
  padding: 0.6rem 0.8rem;
  border: 2px solid #e1e5e9;
  border-radius: 8px;
  min-width: 280px;
`;

const CardGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(3, minmax(0, 1fr));
  gap: 12px;
  @media (max-width: 1200px) { grid-template-columns: repeat(2, minmax(0, 1fr)); }
  @media (max-width: 700px) { grid-template-columns: 1fr; }
`;

const Card = styled.div`
  background: white;
  border-radius: 10px;
  padding: 12px;
  box-shadow: 0 5px 20px rgba(0,0,0,0.08);
`;

const Row = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
`;

const Name = styled.div`
  font-weight: 800;
  color: #111827;
`;

const Meta = styled.div`
  color: #6b7280;
  font-size: 0.9rem;
`;

const Badge = styled.span`
  display: inline-block;
  padding: 2px 8px;
  border-radius: 999px;
  font-size: 12px;
  font-weight: 700;
  color: ${p => (p.$ok ? '#065f46' : '#7c2d12')};
  background: ${p => (p.$ok ? '#d1fae5' : '#fee2e2')};
`;

const Empty = styled.div`
  padding: 1rem;
  color: #6b7280;
`;

const Cliente = () => {
  const [items, setItems] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [search, setSearch] = useState('');
  const API_BASE_URL = process.env.REACT_APP_API_URL || '';

  useEffect(() => {
    (async () => {
      setLoading(true);
      setError('');
      try {
        const dominio = authService.getCurrentClient()?.dominio;
        const res = await axios.get(`${API_BASE_URL}/clientes`, { params: { dominio } });
        const data = res.data || {};
        if (!data.success) throw new Error(data.message || 'Falha ao listar clientes');
        setItems(Array.isArray(data.clientes) ? data.clientes : []);
      } catch (e) {
        setError(e.message || 'Erro ao carregar clientes');
      } finally {
        setLoading(false);
      }
    })();
  }, []);

  const filtered = useMemo(() => {
    const q = search.trim().toLowerCase();
    if (!q) return items;
    return items.filter(c => String(c.nome || '').toLowerCase().includes(q) || String(c.contato || '').toLowerCase().includes(q));
  }, [items, search]);

  return (
    <Container>
      <Title>Clientes</Title>
      {error && <div style={{ background: '#fee', color: '#c33', padding: '8px 10px', borderRadius: 8, marginBottom: 10 }}>{error}</div>}
      <Controls>
        <SearchInput placeholder="Buscar por nome ou contato" value={search} onChange={e => setSearch(e.target.value)} />
      </Controls>

      {loading ? (
        <Empty>Carregando...</Empty>
      ) : filtered.length === 0 ? (
        <Empty>Nenhum cliente encontrado.</Empty>
      ) : (
        <CardGrid>
          {filtered.map(c => (
            <Card key={c.id_cliente}>
              <Row>
                <Name>{c.nome}</Name>
                <Badge $ok={c.convenio === true}>{c.convenio ? 'Convênio' : 'Particular'}</Badge>
              </Row>
              <Meta>{c.contato || '—'}</Meta>
              <Meta>CPF: {c['cpf-carteira'] || '—'}</Meta>
              <Meta>Primeira consulta: {c.primeira_msg ? 'Sim' : 'Não'}</Meta>
              <Meta>Data nascimento: {c.data_nascimento || '—'}</Meta>
            </Card>
          ))}
        </CardGrid>
      )}
    </Container>
  );
};

export default Cliente;
